e":"SaveTool","id":"p806865"},{"type":"object","name":"ResetTool","id":"p806866"},{"type":"object","name":"HelpTool","id":"p806867"}]}},"toolbar_location":"above","left":[{"type":"object","name":"LinearAxis","id":"p806850","attributes":{"ticker":{"type":"object","name":"BasicTicker","id":"p806851","attributes":{"mantissas":[1,2,5]}},"formatter":{"type":"object","name":"BasicTickFormatter","id":"p806852"},"axis_label":"Probability Density","major_label_policy":{"type":"object","name":"AllLabels","id":"p806853"}}},{"type":"object","name":"Legend","id":"p806877","attributes":{"location":"top_left","click_policy":"hide","items":[{"type":"object","name":"LegendItem","id":"p806878","attributes":{"label":{"type":"value","value":"Observed"},"renderers":[{"id":"p806874"}]}},{"type":"object","name":"LegendItem","id":"p806888","attributes":{"label":{"type":"value","value":"LSTM Ensemble"},"renderers":[{"id":"p806885"},{"id":"p806895"},{"id":"p806904"},{"id":"p806913"},{"id":"p806922"},{"id":"p806931"},{"id":"p806940"},{"id":"p806949"},{"id":"p806958"},{"id":"p806967"}]}},{"type":"object","name":"LegendItem","id":"p806979","attributes":{"label":{"type":"value","value":"POR Observed"},"renderers":[{"id":"p806976"}]}},{"type":"object","name":"LegendItem","id":"p806989","attributes":{"label":{"type":"value","value":"timeEnsemble"},"renderers":[{"id":"p806986"}]}},{"type":"object","name":"LegendItem","id":"p806999","attributes":{"label":{"type":"value","value":"distEnsemble"},"renderers":[{"id":"p806996"}]}},{"type":"object","name":"LegendItem","id":"p807009","attributes":{"label":{"type":"value","value":"LN_MLE"},"renderers":[{"id":"p807006"}]}},{"type":"object","name":"LegendItem","id":"p807019","attributes":{"label":{"type":"value","value":"LN_PredictedLog"},"renderers":[{"id":"p807016"}]}},{"type":"object","name":"LegendItem","id":"p807029","attributes":{"label":{"type":"value","value":"LN_PredictedMOM"},"renderers":[{"id":"p807026"}]}},{"type":"object","name":"LegendItem","id":"p807039","attributes":{"label":{"type":"value","value":"KNN_2_NN"},"renderers":[{"id":"p807036"}]}},{"type":"object","name":"LegendItem","id":"p807049","attributes":{"label":{"type":"value","value":"KNN_4_NN"},"renderers":[{"id":"p807046"}]}},{"type":"object","name":"LegendItem","id":"p807059","attributes":{"label":{"type":"value","value":"KNN_8_NN"},"renderers":[{"id":"p807056"}]}}]}}],"below":[{"type":"object","name":"LogAxis","id":"p806845","attributes":{"ticker":{"type":"object","name":"LogTicker","id":"p806846","attributes":{"num_minor_ticks":10,"mantissas":[1,5]}},"formatter":{"type":"object","name":"LogTickFormatter","id":"p806847"},"axis_label":"Unit Area Runoff (L/s/km2)","major_label_policy":{"type":"object","name":"AllLabels","id":"p806848"}}}],"center":[{"type":"object","name":"Grid","id":"p806849","attributes":{"axis":{"id":"p806845"}}},{"type":"object","name":"Grid","id":"p806854","attributes":{"dimension":1,"axis":{"id":"p806850"}}}]}}]}},{"type":"object","name":"Row","id":"p807445","attributes":{"children":[{"type":"object","name":"Div","id":"p807441","attributes":{"width":1000,"text":"\n&lt;h2&gt;Notes:&lt;/h2&gt;\n&lt;p style=\"margin-left:10px;\"&gt;\n&lt;h3&gt;Methods:&lt;/h3&gt;\n&lt;strong&gt;timeEnsemble&lt;/strong&gt;: Temporally-averaged LSTM ensemble.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;distEnsemble&lt;/strong&gt;: Distribution-averaged LSTM ensemble.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;MLE&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution fitted by maximum likelihood to observed data&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;PredictedLog&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution using predicted log-mean \\( \\mu \\) and log-standard deviation \\( \\sigma \\), i.e., parameters of \\( \\log Q \\sim \\mathcal{N}(\\mu, \\sigma^2) \\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;LN&lt;sub&gt;PredictedMOM&lt;/sub&gt;&lt;/strong&gt;: Log-normal distribution using predicted mean and standard deviation of \\( Q \\), with parameters estimated by method of moments.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KNN&lt;/strong&gt;: Attribute-based ensemble estimate using average distribution from the 2 and 8 nearest neighbors (2/8-NN) selected by similarity in catchment attributes.&lt;br&gt;&lt;br&gt;\n&lt;h3&gt;Performance Measures&lt;/h3&gt;\n&lt;strong&gt;RMSE&lt;/strong&gt;: Root Mean Square Error, \\( \\sqrt{ \\frac{1}{N} \\sum_{t=1}^{N} \\left( Q_{\\text{sim}}(t) - Q_{\\text{obs}}(t) \\right)^2 } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;VE&lt;/strong&gt;: Volume Efficiency, \\( 1 - \\frac{ \\left| \\sum Q_{\\text{sim}} - \\sum Q_{\\text{obs}} \\right| }{ \\sum Q_{\\text{obs}} } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;PMF/FDC&lt;sub&gt;Volume Bias&lt;/sub&gt;&lt;/strong&gt;: Relative bias in expected flow from estimated PMFs/FDCs, \\( \\frac{ \\mathbb{E}[Q_{\\text{sim}}] - \\mathbb{E}[Q_{\\text{obs}}] }{ \\mathbb{E}[Q_{\\text{obs}}] } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;RE&lt;/strong&gt;: Relative error, computed as \\( \\frac{F_{\\text{sim}}(p) - F_{\\text{obs}}(p)}{F_{\\text{obs}}(p)} \\), where \\( F(p) \\) denotes the duration curve (FDC) for exceedance duration \\(p\\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;NSE&lt;/strong&gt;: Nash\u2013Sutcliffe Efficiency, defined as \\( 1 - \\frac{\\sum (Q_{\\text{sim}} - Q_{\\text{obs}})^2}{\\sum (Q_{\\text{obs}} - \\bar{Q}_{\\text{obs}})^2} \\). Values closer to 1 indicate better performance.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KGE&lt;/strong&gt;: Kling\u2013Gupta Efficiency, combining correlation, variability, and bias:&lt;br&gt;\n\\( \\quad \\mathrm{KGE} = 1 -\\ \\sqrt{(r - 1)^2 + (\\alpha - 1)^2 + (\\beta - 1)^2} \\)&lt;br&gt;\n\\(\\quad\\)&lt;strong&gt;r&lt;/strong&gt;: Pearson correlation; &lt;strong&gt;\u03b1&lt;/strong&gt;: ratio of standard deviations \\( \\left( \\frac{\\sigma_{\\text{sim}}}{\\sigma_{\\text{obs}}} \\right) \\); &lt;strong&gt;\u03b2&lt;/strong&gt;: bias ratio \\( \\left( \\frac{\\mu_{\\text{sim}}}{\\mu_{\\text{obs}}} \\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KLD&lt;/strong&gt;: Kullback\u2013Leibler divergence between observed and simulated distributions:&lt;br&gt;\n\\( \\quad D_{\\mathrm{KL}}(P \\parallel Q) = \\sum P(x) \\log \\left(\\frac{P(x)}{Q(x)}\\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;EMD&lt;/strong&gt;: Sum of absolute differences between cumulative distributions: \\( \\mathrm{EMD}(P, Q) = \\sum_x \\left| \\mathrm{CDF}_P(x) - \\mathrm{CDF}_Q(x) \\right| \\)\n&lt;/p&gt;\n"}}]}}]}}]}}
